import { FaBell, FaBars, FaSearch } from 'react-icons/fa';

export default function MobileNavbar() {
  return (
    <nav className="bg-white px-4 py-2 flex justify-between items-center shadow-sm md:hidden">
      {/* Élément gauche - Menu */}
      <FaBars className="text-xl text-gray-800" />

      {/* Élément central - Recherche */}
      <div className="flex items-center justify-center">
        <FaSearch className="text-lg text-gray-600" />
      </div>

      {/* Éléments droite - Notification + Profil */}
      <div className="flex items-center gap-2">
        {/* Notification */}
        <div className="w-8 h-8 bg-white rounded-full shadow flex items-center justify-center relative">
          <FaBell className="text-sm text-gray-600" />
          <span className="absolute top-0.5 right-0.5 w-1.5 h-1.5 bg-cyan-500 rounded-full"></span>
        </div>

        {/* Profil */}
        {/* <div className="w-8 h-8 bg-white rounded-full shadow flex items-center justify-center overflow-hidden">
          <img
            src="https://randomuser.me/api/portraits/women/44.jpg"
            alt="Profil"
            className="w-full h-full object-cover"
          />
        </div> */}
      </div>
    </nav>
  );
}
